commits.content:
class HomeServiceModel {
  final String country;
  final String code;

  const HomeServiceModel({required this.country, required this.code});

  factory HomeServiceModel.fromJson(Map<String, dynamic> json) {
    return HomeServiceModel(
        country: json['country'], code: json['calling_code']);
  }
}
